import React, { Component } from "react";
import apiURL from "../../apiUrl";
import { axiosInstance } from "axios";

export default class PostDetail extends Component {
  componentDidMount() {
    axiosInstance.get(apiURL + this.props.match);
  }

  render() {
    return <div></div>;
  }
}
